function run_smth()
	vars = [Symbol("x"),Symbol("y"),Symbol("z"),Symbol("a"),Symbol("b")]
	for x = 1:5
		a = buildRandomPoly(Int, 1:5, 5:10, 2:5, true, Int(100))
		b = buildRandomPoly(Int, length(a.vars), 5:10, 2:5, true, Int(100))
		a.vars = vars[1:length(a.vars)]
		println(a)
		b.vars = vars[1:length(b.vars)]
		println(b)
		println()
	end
end

function run_smth2()
	bruh = parsePoly(Float32, "47x^3*y^2 + 12x^3 + 7x^2*y^4 - 47x^2*y - 71x*y^6 + 70x*y^3 - 15x*y - 82y^6 + 30y^3 - 25y")
	println(bruh)
	println()
	println(typeof(bruh))
	println(bruh.vars)
	println(length(bruh.terms))
	println()
	for x = 1:length(bruh.terms)
		println(bruh.terms[x])
	end
end

